script: |
  super -f text -I q12838.spq | sort > q12838.out

inputs:
  - name: q12838.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN 20 AND + col1 AND NOT ( NULL ) BETWEEN + - col1 + - col0 + col0 * - col0 AND - col1 * 38 * ( - col2 ) * + ( col1 ) * - CAST ( + - 18 AS INTEGER ) - 28;
  - name: tab1

outputs:
  - name: q12838.out
    data: |
